export default function MapPane() {
  return (
    <iframe id="map" src="https://www.google.com/maps/embed/v1/place?key=AIzaSyB8gNdm5uw0zkEZhknd0nLiUhbrd8K3kjw&q=Princeton,New+Jersey">
    </iframe>
  );
}
